CREATE FUNCTION update_allobjectregions() RETURNS boolean
    LANGUAGE plpgsql
    AS $$DECLARE
objectres tblobject%ROWTYPE;
BEGIN

  DELETE FROM tblobjectregion;

  FOR objectres in SELECT tblobject.* from tblobject where tblobject.location is not null LOOP
