--
-- Name: vmeasurementmodifiedtrigger(); Type: FUNCTION; Schema: cpgdb; Owner: -
--

CREATE FUNCTION vmeasurementmodifiedtrigger() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
   IF NEW.isGenerating = TRUE THEN
      RETURN NEW;
   END IF;

   NEW.lastModifiedTimestamp = current_timestamp;

   PERFORM cpgdb.CreateMetaCache(NEW.VMeasurementID);

   RETURN NEW;
EXCEPTION
   WHEN internal_error THEN
      RAISE NOTICE 'WARNING: Failed to create metacache for %', NEW.VMeasurementID;
      RETURN NEW;
END;
$$;


